open! Core

(* http://rosalind.info/problems/ba1c/ *)

let rev_comp text =
  String.init (String.length text) ~f:(fun x ->
      match text.[String.length text - x - 1] with
      | 'C' -> 'G'
      | 'G' -> 'C'
      | 'A' -> 'T'
      | 'T' -> 'A'
      | x -> x)
;;

let%expect_test "" = print_s [%sexp (rev_comp "" : string)];
  [%expect {|  |}]
